import time, timeit, bisect

def minKBitFlips(A, K):
        if len(A) < K: return -1
        ans = 0
        start = 0
        while start+K <= len(A):
            if A[start] == 0:
                for i in range(start, start+K): A[i] = not A[i]
                ans += 1
            start += 1
        s, e = 0, len(A)-1
        while s <= e:
            if A[s] == 0 or A[e] == 0: return -1
            s += 1
            e -= 1
        return ans

def minKBitFlips(A, K):
    res = 0
    s = []
    for i in range(len(A)):
        index = bisect.bisect_right(s, i)
        print("index: ", index)
        # if influenced, flip it and then judge
        if (len(s) - index) % 2 == 1:
            A[i] = 1 - A[i]
        # only consider it when A[i] == 0
        if A[i] == 1: continue
        if len(A)-i < K: return -1
        res += 1
        s.append(i + K)
    return res

